import React, { useEffect, useState } from "react";
import axios from "axios";
import Card from "../components/Card";

const ContactList = () => {
  const [contacts, setContacts] = useState([]);
  const [searchText, setSearchText] = useState("");
  const getContactsList = () => {
    axios.get("./contacts.json").then((response) => {
      setContacts(response.data);
    });
  };
  useEffect(() => {
    getContactsList();
  });

  let contactList = contacts.map((contactItem, i) => {
    return (
      <Card
        key={i}
        name={contactItem.fullName}
        email={contactItem.emailAddress}
        phone={contactItem.phoneNumber}
      ></Card>
    );
  });

  return (
    <div className="contact-list">
      <h1 className="title title_underline">Contacts</h1>
      <ul>
        <li>
          <a>A</a>
        </li>
        <li>
          <a>b</a>
        </li>
        <li>
          <a>c</a>
        </li>
        <li>
          <a>M</a>
        </li>
        <li>
          <a>H</a>
        </li>
      </ul>
      <div className="list-wrapper">{contactList}</div>
    </div>
  );
};

export default ContactList;
